ns2:WprowadzenieDoSprawozdaniaFinansoweg.ns2:P_4:
Sprawozdanie finansowe zostało przygotowane zgodnie z przepisami ustawy z dnia 29 września 1994 roku 
o rachunkowości (Dz. U. 2023, poz. 120, zwanej dalej ”Ustawą”). 
Zgodnie z załącznikiem nr 5 do ustawy o rachunkowości  przewidzianych dla jednostek małych zastosowano następujące uproszczenia: 
1.	Na podstawie art. 46.5 pkt. 5 – Bilans w uproszczonej wersji;
2.	Na podstawie art. 47.4 pkt. 5 – Rachunek Zysków i Strat w wariancie porównawczym w uproszczonej, wersji;
3.	Na podstawie art. 48.4  – zakres informacji dodatkowej;
4.	Na podstawie art. 48 a.4  – nie sporządza się zmian w kapitale własnym;
5.	Na podstawie art. 48 b.5  – nie sporządza się Rachunku Przepływów Pieniężnych.
